    false,nt"url": null,nt"notes": "Falcataria moluccana (albizia) is one of
    the fastest-growing trees in the world. Planted as a reforestation tree starting
    around 1917, it has come to dominate significant portions of Ou2018ahuu2019s low-elevation
    forest (e.g. Manoa, Kaneohe, Maunawili, Waikane). It is now infiltrating largely
    intact native forest at higher elevations. It is scattered within the 4,700-acre
    OFNWR, decreasing in density as one moves toward the summit. To assess the threat
    and possible approaches for addressing it at OFNWR, KMWP aerially mapped F. moluccana
    trees in the northeast quadrant of the Refuge where most of the high-elevation population
    presently resides (~50 albizia trees). A second aerial survey was conducted to scope
    accessibility of a sampling of the trees (see map). Of 16 trees evaluated, 13 appear
    from the air to be accessible from the ground.",nt"license_title": "License
